import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Dashboard from "./components/dashboard";
import CreateTask from "./components/create_task";
import Edit from "./components/edit";
import AddRecipe from "./components/AddRecipe";
import RecipeDetails from "./components/RecipeDetails";
import Profile from "./components/profile"; 
imp 

function App() {
  return (
    <BrowserRouter>
      <div className="app-container">
        {/* Sidebar */}
        <div className="sidebar">
          <button onClick={() => window.location.href = "/dashboard"}>Go to Dashboard</button>
          <button onClick={() => window.location.href = "/profile"}>Go to Profile</button>
          <button onClick={() => window.location.href = "/assignments"}>Go to Tasks</button>
        </div>

        {/* Main Content */}
        <div className="content">
          <Routes>
            <Route path="/" element={<div>Welcome to Study Planner</div>} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/assignments" element={<CreateTask />} />
            <Route path="/edit/:id" element={<Edit />} />
            <Route path="/addrecipe" element={<AddRecipe />} />
            <Route path="/recipe/:id" element={<RecipeDetails />} />
            <Route path="/profile" element={<Profile />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
